import React from 'react';
import '../../css/login/AccountForm.css';

class CreateAccountForm extends React.Component {
    constructor(props) {
        super(props);
        this.handleAppStateChange = this.handleAppStateChange.bind(this);
    }

    handleAppStateChange() {
        this.props.onAppStateChange('LoggingIn');
    }

    render() {
        return (
            <div className="CreateAccountContent">
                
                <div className="AccountFormContainer">
                    <h2>Create Account</h2>
                    <form className="AccountForm">
                        <ul>
                            <li>
                                <label for="username">Username: </label>
                                <input type="text" id="username" name="username" required />
                            </li>
                            <li>
                                <label for="password">Password: </label>
                                <input type="text" id="password" name="password" required />
                            </li>
                            <li className="CreateAccountFormBtns">
                                <button type="submit" className="ContentBtn">Create Account</button>
                                <button type="button" className="ContentBtn" onClick={this.handleAppStateChange}>Cancel</button>
                            </li>
                        </ul>
                    </form>
                </div>
            </div>
        );
    }
}

export default CreateAccountForm;
